const BASE_URL = "https://5e9935925eabe7001681c856.mockapi.io/api/v1/catalog/";

export async function getCatalog() {
    fetch("https://5e9935925eabe7001681c856.mockapi.io/api/v1/catalog/")
        .then(res => res.json())
        .then(data => setProducts([...data]));
}
